    { name = "torch", version = "2.7.1", source = { registry = "https://download.pytorch.org/whl/cpu" }, marker = "sys_platform == 'darwin'" },
    { name = "torch", version = "2.7.1+cpu", source = { registry = "https://download.pytorch.org/whl/cpu" }, marker = "sys_platform != 'darwin'" },
]

[package.optional-dependencies]
plot = [
    { name = "matplotlib" },
    { name = "numpy" },
    { name = "pandas" },
    { name = "ptitprince" },
    { name = "scipy", version = "1.15.3", source = { registry = "https://pypi.org/simple" }, marker = "python_full_version < '3.11'" },
    { name = "scipy", version = "1.16.0", source = { registry = "https://pypi.org/simple" }, marker = "python_full_version >= '3.11'" },
    { name = "seaborn" },
]

[package.metadata]
requires-dist = [
    { name = "matplotlib", marker = "extra == 'plot'", specifier = "<3.9" },
    { name = "numpy", marker = "extra == 'plot'", specifier = "<2" },
    { name = "pandas", marker = "extra == 'plot'", specifier = "<2" },
    { name = "pennylane" },
    { name = "ptitprince", marker = "extra == 'plot'" },
    { name = "scipy", marker = "extra == 'plot'" },
    { name = "seaborn", marker = "extra == 'plot'" },
    { name = "torch", index = "https://download.pytorch.org/whl/cpu" },
]
provides-extras = ["plot"]

